import React, { Component } from "react";
import AppNav from "../AppNav/AppNav";
import AppLogo from "../AppNav/AppLogo";

import "./AppHeader.css";

class AppHeader extends Component {
    render() {
        return (
            <header>
                <AppLogo />
                <AppNav />
            </header>
        );
    }
}

export default AppHeader;
